import React from "react";
import styled from "styled-components";
import { Card } from "./index";
export const CardContext = () => {
  return <Container>
    <Card />
  </Container>;
};

const Container = styled.div`
  margin: 20px 0;
  width: 100%;
  height: 100%;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  align-items: center;
  justify-items: center;
  gap: 30px;
`;
